            console.log(team)
        }else{
            return null;
        }
        // return team.length>0 ? (
        //     <TeamInfo team={team}/>
        // ):null;
    }


    return(
        <div>
            {teamInfo(props.teamData)}
        </div>
    )
}

export default header;
